	<text transform="matrix(1 0 0 1 26 146.4878)"><tspan x="0" y="0" font-family="'BWHaasHead-55Roman'" font-size="18">Lt. General Michael DeLong of U.S. </tspan><tspan x="0" y="21.6" font-family="'BWHaasHead-55Roman'" font-size="18">Central Command ordered the attack</tspan><tspan x="0" y="43.2" font-family="'BWHaasHead-55Roman'" font-size="18">on Qaed Salim Sinan al-Harethi, </tspan><tspan x="0" y="64.8" font-family="'BWHaasHead-55Roman'" font-size="18">suspected orchestrator of the U.S.S.</tspan><tspan x="0" y="86.4" font-family="'BWHaasHead-55Roman'" font-size="18">Cole bombing, who was killed as he</tspan><tspan x="0" y="108" font-family="'BWHaasHead-55Roman'" font-size="18">rode in a convoy. Kemal Darwish, a </tspan><tspan x="0" y="129.6" font-family="'BWHaasHead-55Roman'" font-size="18">U.S. citizen who wasn’t deliberately </tspan><tspan x="0" y="151.2" font-family="'BWHaasHead-55Roman'" font-size="18">targeted, was among those killed in the </tspan><tspan x="0" y="172.8" font-family="'BWHaasHead-55Roman'" font-size="18">attack. </tspan></text>
	<text transform="matrix(1 0 0 1 343 419.5312)"><tspan x="0" y="0" font-family="'BWHaasHead-75Bold'" font-size="18">Yemen:  2002-13 </tspan><tspan x="0" y="21.6" font-family="'BWHaasHead-75Bold'" font-size="18">99 strikes, at least 552 killed</tspan></text>
	<rect x="337" y="399.531" fill="none" stroke="#000000" stroke-width="2.6" stroke-miterlimit="10" width="256" height="257"/>
	<line fill="none" x1="341" y1="462.777" x2="551" y2="462.777"/>
	<text transform="matrix(1 0 0 1 343 474.5312)"><tspan x="0" y="0" font-family="'BWHaasHead-55Roman'" font-size="18">Drones have hit targets in </tspan><tspan x="0" y="21.6" font-family="'BWHaasHead-55Roman'" font-size="18">Marib province nine times since</tspan><tspan x="0" y="43.2" font-family="'BWHaasHead-55Roman'" font-size="18">the 2002 strike on al-Harethi. </tspan><tspan x="0" y="64.8" font-family="'BWHaasHead-55Roman'" font-size="18">New Mexico-born Anwar</tspan><tspan x="0" y="86.4" font-family="'BWHaasHead-55Roman'" font-size="18">al-Awlaki and his 16-year-old </tspan><tspan x="0" y="108" font-family="'BWHaasHead-55Roman'" font-size="18">son were killed in separate </tspan><tspan x="0" y="129.6" font-family="'BWHaasHead-55Roman'" font-size="18">attacks in 2011. The total </tspan><tspan x="0" y="151.2" font-family="'BWHaasHead-55Roman'" font-size="18">of U.S. citizens known to have</tspan><tspan x="0" y="172.8" font-family="'BWHaasHead-55Roman'" font-size="18">been killed by drones is five. </tspan></text>

	<text transform="matrix(1 0 0 1 648 652.4883)"><tspan x="0" y="0" font-family="'BWHaasHead-55Roman'" font-size="18">The first known lethal drone strike in</tspan><tspan x="0" y="21.6" font-family="'BWHaasHead-55Roman'" font-size="18">Somalia occured in June 2011 in the </tspan><tspan x="0" y="43.199" font-family="'BWHaasHead-55Roman'" font-size="18">Lower Jubba region, followed by two </tspan><tspan x="0" y="64.799" font-family="'BWHaasHead-55Roman'" font-size="18">strikes in the same location. A single </tspan><tspan x="0" y="86.399" font-family="'BWHaasHead-55Roman'" font-size="18">missile on Oct. 22, 2011 reportedly killed</tspan><tspan x="0" y="108" font-family="'BWHaasHead-55Roman'" font-size="18">11 civilians and injured 20 more in an </tspan><tspan x="0" y="129.6" font-family="'BWHaasHead-55Roman'" font-size="18">airstrike on the town of Afmadow. </tspan></text>
	<text transform="matrix(1 0 0 1 648 598.5312)"><tspan x="0" y="0" font-family="'BWHaasHead-75Bold'" font-size="18">Somalia:  2011-12</tspan><tspan x="0" y="21.6" font-family="'BWHaasHead-75Bold'" font-size="18">7 strikes, at least 23 killed</tspan></text>
